import React, { useState } from 'react'

function ResultList(props) {
  return (
    <div>
      <header className="App-header">
        {props.repos.map((repo, index) => {
          return (
            <div key={index}>
              <h4>{repo.name}</h4>
              <p>{repo.stars} звезд </p>
              <p>Последний коммит {repo.lastCommitDate}</p>
              <p>{repo.url}</p>
            </div>
          )})}
        </header>
    </div>
  )
}

export default ResultList
